        "creatorName": "Craig McDermott",
        "description": {
            "type": "doc",
            "content": [
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "This market may seem somewhat difficult to resolve but this market will lay some simple rules to help guide your choice.",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "The qualification of celebrity,Athlete or Pop Culture Figures exclude any and all pre existing members of the Democratic Party platform, organizers, or elected officials. ",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "The qualifying factor for a counted speaker is a subject that has had undoubtably impacted the American populous with their contribution to professional sports, professional film or television (outside of those currently employed by major news networks which consistently support the Democratic Party;IE Joe from Morning Joe or any major figure tied to NBC,MSNBC,CBS, or any pre scheduled host of the DNC that has a connection to a news agency outside of their speaking at the convention.",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Examples of speakers who would count toward the total Labron James. Katlyn Clark, Robert Denrero, Al Pachino, Katlyn Jenner, Bruce Jenner, Kanye West, Machine-gun Kelly, Kenner Jenning. ",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "No former or current First Ladies, Former or currently serving politicians from any party will count as celebrities as speakers in this market!! ",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "If a non athlete and or professional actor/tv actress or actor has over 4.5 million followers on X (formally twitter) or 20 Million followers on Instagram (not Facebook). These speakers will be considered to be celebrities. ",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "SPEAKER IS CONSIDERED AN INDIVIDUAL THAT QUALIFIES BY SPEAKING FOR MORE THAN 2.15 MINS BUT IS NOT DOING SO AS AN INTRODUCTION ONLY BUT MAKING A STATEMENT IN SUPPORT OF THE PARTY AND CANDIDATES (OR MOVING TO ELECT A NEW CANDIDATE/ PROFER FOR A SHAKE UP @ DNC 2024!!)",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Please give market makers time to",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Tally the results and make sure we are",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Counting the results correctly according to the rules stated for this market and be patient! ",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Thank you and enjoy! ",
                            "type": "text"
                        }
                    ]
                }
            ]
        },
