        "creatorName": "SG",
        "description": {
            "type": "doc",
            "content": [
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "I started feeling a small amount of pain in my lower abdomen on the left side (below the midriff, above the pubic area) last night before going to bed, but didn't think anything of it. This morning I woke up, and the pain had become significantly sharper.",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "I have a family history of kidney stones and diverticulitis. I also ate an entire pomegranate yesterday afternoon. ",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "I've been drinking a ton of water, and I just took a couple pills of ",
                            "type": "text"
                        },
                        {
                            "text": "chanca piedra",
                            "type": "text",
                            "marks": [
                                {
                                    "type": "link",
                                    "attrs": {
                                        "href": "https://www.healthline.com/nutrition/chanca-piedra",
                                        "class": "break-anywhere hover:underline hover:decoration-primary-400 hover:decoration-2 active:underline active:decoration-primary-400",
                                        "target": "_blank"
                                    }
                                }
                            ]
                        },
                        {
                            "text": " (an herb that's heavily alkalizing, used to treat kidney stones). I'm planning to go to a clinic in an hour or two or so if the symptoms don't improve.",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "I'll resolve this market according to my best guess of what the underlying cause is, or N/A if I don't have any idea.",
                            "type": "text"
                        }
                    ]
                }
            ]
        },
