            "type": "doc",
            "content": [
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Neopronouns like ey/em, ze/zir, and xe/xem are much more convenient than they/them, since the fact that they're singular removes ambiguity about whether the pronoun refers to a single person or a group of people, and obviates the need for differing verb conjugations depending on the pronouns of the person being discussed.",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "(Third person pronouns, not pronouns like \"you\" or \"I\".)",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Unfortunately, nobody can agree on which one to use, and it ",
                            "type": "text"
                        },
                        {
                            "text": "doesn't seem to be getting better",
                            "type": "text",
                            "marks": [
                                {
                                    "type": "link",
                                    "attrs": {
                                        "href": "https://www.gendercensus.com/results/2022-worldwide/#pronouns",
                                        "class": null,
                                        "target": "_blank"
                                    }
                                }
                            ]
                        },
                        {
                            "text": ".",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "image",
                    "attrs": {
                        "alt": null,
                        "src": "https://firebasestorage.googleapis.com/v0/b/mantic-markets.appspot.com/o/user-images%2Fdefault%2FwikvdI3QQQ.png?alt=media&token=d2ac5c0c-4a85-46b2-ad33-7b78d6967947",
                        "title": null
                    }
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "If any large, reliable survey shows that at least 75% of nonbinary or otherwise gender non-conforming people who do not prefer he/him, she/her, they/them, or \"no pronouns\" choose the same option, this market resolves YES.",
                            "type": "text"
                        }
                    ]
                }
            ]
