        "question": "Will any company form a defensible moat around LLM-based AI before 2025?",
        "closeTime": 1735711140000,
        "creatorId": "fP5OQUWYt4MW17A2giGjMGsw1uu2",
        "mechanism": "cpmm-1",
        "dailyScore": 0,
        "elasticity": 9.671134643516362,
        "groupSlugs": [
            "ai"
        ],
        "isResolved": false,
        "marketTier": "plus",
        "visibility": "public",
        "createdTime": 1680829920653,
        "creatorName": "Lars Doucet",
        "description": {
            "type": "doc",
            "content": [
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "This market resolves YES, if in my opinion, any company has formed a defensible moat around an LLM-based AI, and it is not yet 2025.",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "What does a defensible moat look like? There's no single perfectly objective test, but it generally looks like this:",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "bulletList",
                    "content": [
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "The company is making a lot of money",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        },
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "They are far ahead of their closest competition both in terms of market share and/or in terms of profits (market share is a really strong indicator tho)",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        },
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "Other companies have a hard time catching up and putting a dent in their market share, even if their technology is \"just as good\" or \"almost as good\"",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        },
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "Alternatively, if nobody else's product/service is anywhere close to as good, that's another good sign of a defensible moat",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        },
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "There's a strong network effect or other source of natural or artificial lock-in that makes it hard for users to leave the ecosystem",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        },
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "The business press talks about them having a defensible moat and even identifies what it is",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "If a legal or natural monopoly is clearly established, that would also probably do the trick. ",
                            "type": "text"
                        }
                    ]
                }
            ]
        },
