        "description": {
            "type": "doc",
            "content": [
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Robin Hanson has famously long AI timelines. For example in ",
                            "type": "text"
                        },
                        {
                            "text": "an interview from 2019",
                            "type": "text",
                            "marks": [
                                {
                                    "type": "link",
                                    "attrs": {
                                        "href": "https://aiimpacts.org/robin-hanson-on-the-futurist-focus-on-ai/",
                                        "class": null,
                                        "target": "_blank"
                                    }
                                }
                            ]
                        },
                        {
                            "text": ", and more recently, ",
                            "type": "text"
                        },
                        {
                            "text": "a podcast",
                            "type": "text",
                            "marks": [
                                {
                                    "type": "link",
                                    "attrs": {
                                        "href": "https://futureoflife.org/podcast/robin-hanson-on-predicting-the-future-of-artificial-intelligence/",
                                        "class": null,
                                        "target": "_blank"
                                    }
                                }
                            ]
                        },
                        {
                            "text": ", he seemed to argue that human-level AI is likely at least a century away. However, many are speculating that AI developments announced in early 2023 will be \"wild\" and will cause people to shorten their AI timelines.",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "This question resolves to YES if Robin Hanson publicly changes his mind before July 1st 2023, and clearly indicates that his median human-level AI timeline has moved to before 2075. Here is a non-exaustive list of example scenarios that would count towards positive resolution:",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "bulletList",
                    "content": [
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "He releases a blog post indicating that he now expects robots to receive >50% of Gross World Product within 5 decades.",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        },
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "He says in a public talk published before July 1st that he now thinks ems will probably be invented in the 2060s.",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        },
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "He says in a podcast that he \"now finds it very plausible\" that the labor force participation rate will fall to <10% due to robots by 2050.",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "If it's ambiguous whether he's changed his mind, I'll tweet at him and ask. If he does not reply within roughly 2 weeks, the question will resolve to N/A. If he does not change his mind, this question resolves to NO.",
                            "type": "text"
                        }
                    ]
                }
            ]
        },
