            "content": [
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Sep 22, 2:38pm: I will resolve as this question as here: ",
                            "type": "text"
                        },
                        {
                            "text": "https://www.metaculus.com/questions/10209/zelenskyy-named-time-person-of-the-year-2022/",
                            "type": "text",
                            "marks": [
                                {
                                    "type": "link",
                                    "attrs": {
                                        "href": "https://www.metaculus.com/questions/10209/zelenskyy-named-time-person-of-the-year-2022/",
                                        "class": "no-underline !text-indigo-700 z-10 break-anywhere hover:underline hover:decoration-indigo-400 hover:decoration-2",
                                        "target": "_blank"
                                    }
                                }
                            ]
                        },
                        {
                            "type": "hardBreak"
                        },
                        {
                            "type": "hardBreak"
                        },
                        {
                            "text": "Fine print from above Metaculus question",
                            "type": "text"
                        },
                        {
                            "type": "hardBreak"
                        },
                        {
                            "type": "hardBreak"
                        },
                        {
                            "text": "If multiple people are named Person of the Year (e.g. in 2020, both Joe Biden and Kamala Harris were named):",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "bulletList",
                    "content": [
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "If Zelenskyy is one of 4 or fewer people or entities named, this question resolves positively.",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        },
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "If he is one of 5 or more people or entities named, it resolves negatively.",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        },
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "We will count, for example, \"Volodymyr Zelenskyy, the Ukrainian people, and the UN\" being given the award as Zelenskyy plus two entities (thus resolving positively).",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        },
                        {
                            "type": "listItem",
                            "content": [
                                {
                                    "type": "paragraph",
                                    "content": [
                                        {
                                            "text": "Simply naming \"the Ukrainian people\" or even \"the Ukrainian government\" without specifically naming Zelenskyy should not be enough to resolve positively, even if his face is shown on the cover.",
                                            "type": "text"
                                        }
                                    ]
                                }
                            ]
                        }
                    ]
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "If Zelenskyy is named Person of the Year posthumously, this question still resolves positively.",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "If Time does not name a Person of the Year for 2022 at all (including if Time ceases to exist), it resolves negatively.",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Sep 22, 2:40pm: ",
                            "type": "text"
                        },
                        {
                            "text": "Zelensky will be Time magazine's Man of the Year  2022",
                            "type": "text",
                            "marks": [
                                {
                                    "type": "strike"
                                }
                            ]
                        },
                        {
                            "text": "  Will Zelensky be named Time magazine's Person of the Year 2022?",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Oct 6, 10:26am: ",
                            "type": "text"
                        }
                    ]
                }
            ]
