        "creatorName": "Charlie",
        "description": {
            "type": "doc",
            "content": [
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Making a few of these conditional markets to decide how much time to invest in the Clearer Thinking Tournament. ",
                            "type": "text"
                        },
                        {
                            "type": "hardBreak"
                        }
                    ]
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "Ultimately, I'm going to work on this tournament however much I choose, but whichever market suggests the highest $/hr will also influence my time budget. So, if the [3hr, 6hr) market suggests the highest $/hr (based on the minimum 3hrs of work), I'll work until I've invested 3 hours and stop.",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "But if then the [9hr,12hr) market takes over as recommending the highest $/hr, I will get back to work and try to reach 9hrs of work. Of course, I might not make it to 9hrs even if it's the recommended amount, so the [9hr,12hr) market might resolve N/A even if it promises the highest $/hr.",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "All markets will resolve N/A except for the one that correctly brackets the time I spent on the tournament.",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "In terms of how I plan to spend this time, I'm not sure, but a draft strategy would be:",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph"
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "I. Manual arbitrage to keep the percentages even",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "II. Bot arbitrage to keep the percentages even",
                            "type": "text"
                        }
                    ]
                },
                {
                    "type": "paragraph",
                    "content": [
                        {
                            "text": "III. Read the actual entries and keep the percentages even but skewed toward my actual ideas of the winners.",
                            "type": "text"
                        }
                    ]
                }
            ]
        },
